import React from "react";
import homeImage from "../../Media/introLeft.JPG";


const MenuPropDisplay = (props) =>{
    let value = props.MenuArray;
    if(value === 0) return (
        <div> left </div>
    )
    else if (value === 2 ){
        return (
            <div> right</div>
        )
    }
    else return (
        <img src={homeImage}/>
    )
}

export default MenuPropDisplay;
